import React from "react";

const Tools = (props) => {
    const { solve, stop, newGame, deleteGame, getThisAsStr, goBack } = props
  return (
    <div>
      <div className="buttons">
        <button className="button is-info" onClick={solve}>Solve</button>
        <button className="button is-success" onClick={stop}>Stop</button>
        <button className="button is-warning" onClick={newGame}>New Game</button>
        <button className="button is-danger" onClick={deleteGame}>Delete</button>
        <button className="button is-warning" onClick={getThisAsStr}>Get this</button>
        <button className="button is-danger" onClick={goBack}>Go back</button>
      </div>
    </div>
  );
};

export default Tools;
